import React, { useState } from 'react';
import Box from '@mui/material/Box';
import Typography from '@mui/material/Typography';
import Paper from '@mui/material/Paper';
import Avatar from '@mui/material/Avatar';
import Divider from '@mui/material/Divider';

const pilotos = [
  {
    id: 1,
    nombre: 'Max Verstappen',
    equipo: 'Red Bull Racing',
    valor: '45.000.000',
    foto: 'https://www.formula1.com/content/fom-website/en/drivers/max-verstappen/_jcr_content/image.img.1920.medium.jpg/1677069654166.jpg',
  },
  {
    id: 2,
    nombre: 'Lewis Hamilton',
    equipo: 'Mercedes',
    valor: '42.000.000',
    foto: 'https://www.formula1.com/content/fom-website/en/drivers/lewis-hamilton/_jcr_content/image.img.1920.medium.jpg/1677069654166.jpg',
  },
  {
    id: 3,
    nombre: 'Charles Leclerc',
    equipo: 'Ferrari',
    valor: '40.000.000',
    foto: 'https://www.formula1.com/content/fom-website/en/drivers/charles-leclerc/_jcr_content/image.img.1920.medium.jpg/1677069654166.jpg',
  },
  {
    id: 4,
    nombre: 'Fernando Alonso',
    equipo: 'Aston Martin',
    valor: '38.000.000',
    foto: 'https://www.formula1.com/content/fom-website/en/drivers/fernando-alonso/_jcr_content/image.img.1920.medium.jpg/1677069654166.jpg',
  },
  {
    id: 5,
    nombre: 'Lando Norris',
    equipo: 'McLaren',
    valor: '36.000.000',
    foto: 'https://www.formula1.com/content/fom-website/en/drivers/lando-norris/_jcr_content/image.img.1920.medium.jpg/1677069654166.jpg',
  },
];

export default function MarketPage() {
  const handleClick = (piloto) => {
    alert(`Perfil de ${piloto.nombre}`);
  };

  return (
    <Box sx={{ p: 2 }}>
      <Typography variant="h5" gutterBottom>Mercado de Pilotos</Typography>
      {pilotos.map((piloto, idx) => (
        <Paper key={piloto.id} sx={{ display: 'flex', alignItems: 'center', p: 2, mb: 2, cursor: 'pointer' }} onClick={() => handleClick(piloto)}>
          <Avatar src={piloto.foto} alt={piloto.nombre} sx={{ width: 56, height: 56, mr: 2 }} />
          <Box sx={{ flexGrow: 1 }}>
            <Typography variant="subtitle1" sx={{ fontWeight: 600 }}>{piloto.nombre}</Typography>
            <Typography variant="body2" color="text.secondary">{piloto.equipo}</Typography>
          </Box>
          <Typography variant="body1" sx={{ fontWeight: 700, color: '#fbc02d' }}>{piloto.valor} â‚¬</Typography>
        </Paper>
      ))}
    </Box>
  );
}
